def S2N(m, n):
  result = 0
  for x in range(n+1):
      for y in range(m+1):
          result += y**x
  return result

def S2N(m,n,x=-1,s=0):
    while x < m: 
        p = -1; x+=1
        while p < n: 
            p+=1; s += (x**p)
    return s

def S2N(m, n):
    s=0
    for x in range(m+1):
        s+=sum(x**y for y in range(n+1))
    return s

